function getToken($content, $key) {
        
    $start = strpos($content, $key);
    $tmp = substr($content, $start+strlen($key));
    $end = strpos($tmp,'"');
    $token = substr($tmp, 0, $end);
    return $token;   
}

function getRssItem($xml, $element) {
    
    $item = $xml->xpath('/rss/channel/item/title');    
    $content['title'] =  strip_tags((string) $item[$element]);
    $content['title'] = substr(mb_convert_encoding(html_entity_decode($content['title']), "pass", "auto"),0, 65); 
        
    $item = $xml->xpath('/rss/channel/item/description');
    $content['description'] =  strip_tags((string) $item[$element]);
    $content['description'] =  substr(mb_convert_encoding(html_entity_decode($content['description']), "pass", "auto"), 0, 351).' ...'; 
    
	$item = $xml->xpath('/rss/channel/item/pubDate');
	$content['date'] = date("d-m-Y H:i:s", strtotime(strip_tags((string) $item[$element])));
    
    $image = $xml->xpath('/rss/channel/item/content:encoded');  
    
    $content['image_url'] = getToken($image[$element], 'src="');    
    $content['image_width'] = getToken($image[$element], 'width="');    
    $content['image_height'] = getToken($image[$element], 'height="');
    
    return $content;
}

